import Carousel from './SpecialsCarousel';
import GreekSalad from '../../../assets/food/greek-salad.webp';
import Bruschetta from '../../../assets/food/bruschetta.jpeg';
import LemonDessert from '../../../assets/food/lemon-dessert.webp';
import SpecialCard from './CardInfo/SpecialCard';

export default function Specials() {
    return (
        <section className="specials">
            <article className="specials-topbar">
                <h1>This weeks specials</h1>
                <a className="action-button" href={require('../../../assets/menu.webp')} target="_blank" rel="noreferrer">Online Menu</a>
            </article>

            <section className="specials-cards">
                <SpecialCard image={GreekSalad} name="West Coast BLT" price="$14.95" description="Bacon, fried egg, avocado, fresh mozzarella 
                on a pressed Challah bread, served with potato chips."/>
                <SpecialCard image={Bruschetta}name="Avocado Toast" price="$16.99" description="Seven grain bread, scramble eggs,
                smashed avocados & grilled cherry tomatoes. Served with lemon & sea salt arugula salad."/>
                <SpecialCard image={LemonDessert} name="Eggs Benedicts" price="$8.50" description="Fresh baked lemon bread coated in salt and sugar. Powdered in citrus
                 and lemon zest."/>

            </section>

            <section className="specials-carousel">
                <Carousel />
            </section>
        </section>
    );
}
